// SPDX-License-Identifier: MIT
// Developed by: Archivist (version: v0.1)
pragma solidity ^0.8.0;

import "./scm-implementations/scm-09.sol";
import "./scm-implementations/scm-07-02.sol";
import "./token/common/ERC2981.sol";
import "./token/ERC721/extensions/ERC721Enumerable.sol";

contract NFTicket is ERC721Enumerable, SaleNFT /* DynamicMetadata  ERC2981 */{

    constructor(
        string memory name,
        string memory symbol,
        string memory baseURI,
        uint256 maxSupply, 
        uint256 mintPrice,
        uint256 maxTokensPerAddress
    ) ERC721(name, symbol)
      MintCapped(maxSupply, mintPrice, maxTokensPerAddress)
      //DynamicMetadata(baseURI)
    {
      //_setDefaultRoyalty(_msgSender(), 500);
    }



    function tokenURI(uint256 tokenId) public view override(ERC721) returns (string memory) {
        return super.tokenURI(tokenId);
    }

    function _baseURI() internal view override(ERC721) returns (string memory) {
        return super._baseURI();
    }

    function supportsInterface(bytes4 interfaceId) public view virtual override(MintCapped, ERC721Enumerable) returns (bool) {
        return super.supportsInterface(interfaceId);
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId,
        uint256 batchSize
    ) internal override(ERC721Enumerable) {
        super._beforeTokenTransfer(from, to, tokenId, batchSize);
    }


}
